import React, { useEffect,} from "react";
import { connect } from "react-redux";

import {fetchMalls,} from "../../Store/actions"
import store from "../../Store"

const Mallsdata = (all_malls) => {

  useEffect(() => {
    fetchMalls()}, []);
   
  return (
    <div>
      {store.getState()}
      {all_malls.name}        
    </div>
  );
};

const mapStateToProps = ({malls}) => ({
  all_malls: malls.all_malls,
});

const mapDispatchToProps = {fetchMalls,};

export default connect(mapStateToProps,mapDispatchToProps)(Mallsdata);
